var updateDetailList = function (detailListId, advisories) {
	var encoded =advisories[waterbodyIndex][2][speciesIndex];
	//$(detailListId + "Info").html("You can have the following maximum number of meals per month for <strong>General Population</strong> and <font color=\"#FF0000\"><strong>Sensitive Population</strong></font> (Women of child-bearing age and children under 15) according to the length of your selected species (<strong>" + speciesListinAdvisory[speciesIndex] + "</strong>) and lakes (<strong>" + advisories[waterbodyIndex][4] +"</strong>). <br><br><br><br>");	
	var decodeMap = {"x": "xx","a": "00","b": "20","c": "10","d": "88","e": "44","f": "84","g": "40","h": "80","i": "11","j": "48","k": "42"};
	var lenstr = "";
	var output = "";
	var arr = encoded.split('');
	for (var i = 0; i< arr.length; i++) {
		var ch = arr[i];
		if(decodeMap.hasOwnProperty(ch)) {
			output += new Array(1+parseInt(lenstr)).join(decodeMap[ch]);
			lenstr = "";
		} else {
			lenstr += ch;
		}
	}
	var lengthList = ["15-20","20-25","25-30","30-35","35-40","40-45","45-50","50-55","55-60","60-65","65-70","70-75",">75"];
	$(detailListId).html(Array.range(0, lengthList.length - 1).map(function(i) {
		if ((output[2*i] === 'x') && (output[2*i + 1] === 'x')) {
			return "";
		} else if ((output[2*i] !== 'x') && (output[2*i + 1] === 'x')) {
			return "<li>Length " + lengthList[i] +  " cm: NA / " + output[2*i + 1] + "</li>\n";		   
		} else if ((output[2*i] === 'x') && (output[2*i + 1] !== 'x')) {
			return "<li>Length " + lengthList[i] +  " cm: " + output[2*i] + " / NA</li>\n";		   
		} else { 
			return "<li>Length " + lengthList[i] +  " cm: " + output[2*i] + " / <font color=\"#FF0000\">" + output[2*i + 1] + "</font></li>\n";
		}
	}).join(""));
	$(detailListId).listview('refresh');
}; 

var filterAdvisoriesWithDistance = function (lat, lon) {
	var calculateDist = function(lat1, lon1, lat2, lon2){
		var R = 6371; // km
		var dLat = (lat2-lat1).toRad();
		var dLon = (lon2-lon1).toRad();
		var lat1 = lat1.toRad();
		var lat2 = lat2.toRad();
		var a = Math.sin(dLat/2) * Math.sin(dLat/2) +
				Math.sin(dLon/2) * Math.sin(dLon/2) * Math.cos(lat1) * Math.cos(lat2); 
		var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a)); 
		var d = R * c;
		return d;
	};
	/*var calculateDist = function (lat1, lng1, lat2, lng2) {
		return 1.60934*Math.sqrt( Math.pow(69 * (lat2 - lat1), 2) + Math.pow(53 * (lng2 - lng1), 2) );
	};*/
	return advisories.map(function(a) {
			return [a[0], a[1], a[2], calculateDist(a[0], a[1], lat, lon), a[3]];
		}).filter(function(a) {
			return a[3] < searchRadius;
		}).sort(function(a, b) {
			if (a[3] < b[3])
				return -1;
			if (a[3] > b[3])
				return 1;
			return 0;
		});
};


